import React, { useState } from "react";
import { Container, Row, Col, Form } from "react-bootstrap";

function SearchPlayer() {
    const [searchTerm, setSearchTerm] = useState({
        playerName: "",
        team: "",
        playerType: "",
        nationality: ""
    })

    const handleChange = (e) => {
        setSearchTerm({...searchTerm, [e.target.name]: e.target.value})
    }

    return (
        <Container className="mt-5">
            <h3 className="text-center bg-danger text-white">
                Tra cứu cầu thủ
            </h3>
            <Form className="text-center">
                <Row>
                    <Col>
                        <Form.Label>
                            <b>Tên cầu thủ</b>
                        </Form.Label>
                        <Form.Control type="text" onChange={handleChange} name="playerName" value={searchTerm.playerName}></Form.Control>
                    </Col>
                    <Col>
                        <Form.Label>
                            <b>Đội</b>
                        </Form.Label>
                        <Form.Control type="text"></Form.Control>
                    </Col>
                    <Col>
                        <Form.Label>
                            <b>Loại cầu thủ</b>
                        </Form.Label>
                        <Form.Control type="text"></Form.Control>
                    </Col>
                    <Col>
                        <Form.Label>
                            <b>Quốc tịch</b>
                        </Form.Label>
                        <Form.Control type="text"></Form.Control>
                    </Col>
                </Row>
            </Form>
        {searchTerm.playerName}
        {searchTerm.team}
        {searchTerm.playerType}
        {searchTerm.nationality}
        </Container>
    );
}

export default SearchPlayer;
